import {Link, useNavigate} from "react-router-dom";

export default function Home() {
    const navigate = useNavigate();
    const clickHandler = () => {
        navigate('/posts');
    }
    return (
        <div>
            <h1>Home</h1>
            <div>
                {/*<Link to={'/posts'}>Move to posts page</Link>*/}
                <button onClick={clickHandler}>posts</button>
            </div>
        </div>
    );
}
